import { Stack, Typography } from "@mui/material";

const Sidebar = () => {
  return (
    <Stack spacing={3}>
      <Stack direction="row">
        <Typography>1</Typography>
        <Typography>KY Sheet Details</Typography>
      </Stack>
    </Stack>
  );
};
export default Sidebar;
